[[File:Tooth half of key detail.png|left|130px]]
The '''tooth half of key''' is an item dropped by any [[monster]] that has access to the [[rare drop table]]. It is also a reward from various [[random events]], the [[gnome restaurant]], from [[Managing Miscellania]], [[casket]]s, looting [[magpie impling]]s, and unlocking the [[crystal chest]] in [[Taverley]]. It can also be found in the [[Barrows]] chest as a separate item if the player has 100%{{CiteTwitter|author=Mod Kieren|url=https://twitter.com/JagexKieren/status/705428283509366785|date=3 March 2016|archiveurl=https://archive.is/sB4lx|archivedate=2 September 2017|quote=You guys wanted info on Barrows loot, here it is... Full size: [http://i.imgur.com/oZSMkAX.png] Explained the best I can!}} rewards potential.

The tooth half of a key is used with a [[loop half of key]] to make a [[crystal key]], which is used to unlock the [[crystal chest]], which contains a [[dragonstone]] and an assortment of other items.
